def productExceptSelfNoExtraSpace(nums):
    # O(1) space complexity without extra space
    # O(n) time complexity
    a = len(nums)
    res = [1] * a
    cur = 1
    for i in range(a):
        res[i] = res[i] * cur
        cur *= nums[i]
    cur = 1
    for i in range(a-1,-1,-1):
        res[i] = res[i] * cur
        cur *= nums[i]
    return res

def productExceptSelfExtraSpace(nums):
    # O(1) space complexity, but with extra space
    # O(n) time complexity
    a = len(nums)
    res = [1] * a
    pref_sum = [1] * a
    suff_sum = [1] * a
    pref_sum[0] = 1
    for i in range(1, a):
        pref_sum[i] = pref_sum[i-1] * nums[i-1]
    suff_sum[-1] = 1
    for i in range(a-2,-1,-1):
        suff_sum[i] = suff_sum[i+1] * nums[i+1]
    for i in range(a):
        res[i] = pref_sum[i] * suff_sum[i]
    return res

